    /***************************************
    * Purpose:- This Method return 'json' of forms fields 
    * Method Name:- $.formBindJSON
    * Parameters:_formID
    ***************************************/

    $.formBindJSON = (_formID) => {
        if (typeof _formID != "undefined" && _formID != "" && _formID.length > 0) {

            var _frmObj = $(_formID),
                _iTag = 'span',
                _isExist = "",
                _isRequirtedExist,
                _responseStatus = true,
                formControl = _frmObj.find('select , input , textarea');
            var _arr = [], obj = {};

            $.each(formControl, (indx, elm) => {

                var _this = $(elm);
                if (_this.hasAttr("name")) {
                    if (_this.is('input')) {
                        if (_this.is('input[type="checkbox"]')) {
                            if (_this.is(":checked")) {
                                obj[_this.attr('name')] = _this.val();
                            }
                        }
                        else if (_this.is('input[type="Date"]')) {                            
                            obj[_this.attr('name')] = $.DateFormtChng(_this.val());
                            
                        }
                        else {
                            obj[_this.attr('name')] = _this.val();
                        }
                        
                    }
                    if (_this.is('textarea')) {
                        obj[_this.attr('name')] = _this.val();
                    }

                    if (_this.is('select')) {
                        obj[_this.attr('name')] = _this.children('option').filter(":selected").val();
                    }
                }
            })
            _arr.push(obj);
        }
        return (JSON.stringify(_arr));
    }


    /********************************************
    * Purpose:- This Method will return the date format dd-mm-yyyy
    * Method Name:- $.DateFormtChng
    * Parameters:- This parameter "_date" will pass and split the date into Date/Month/Year    
    *********************************************/

    $.DateFormtChng = (_date) => {
        var _splitDate = _date.split("-");
        var _day = _splitDate[2],
            _month = _splitDate[1],
            _year = _splitDate[0];
        return _splitDate = _day + "-" + _month + "-" + _year;
    }


    $.fn_FIRST_LETTER_CAPITAL = (_char) => {
        return _char.charAt("0").toUpperCase() + _char.slice(1);
    }

    $.fn_FIRST_LETTER_CAPITAL_ALSO_AFTER_SPACE = (_char) => {
        var str = _char;
        var result = str.split(" ").map(element => {
            return element[0].toUpperCase() + element.slice(1);
        });
        return result = result.join(" ")
        //console.log(result);

    }





